import React, { useState } from "react";

function ShoppingCart() {
  const [cart, setCart] = useState([]);

  const [items, setItems] = useState([
    {
      id: 1,
      name: "orange",
      img: "https://img.theculturetrip.com/wp-content/uploads/2018/03/origins-of-the-word-orange.jpg",
    },
    {
      id: 2,
      name: "tomatoes",
      img: "data:image/jpeg;base64,",
    },
    {
      id: 3,
      name: "Rice",
      img: "https://cdn.britannica.com/17/176517-050-6F2B774A/Pile-uncooked-rice-grains-Oryza-sativa.jpg",
    },
    {
      id: 3,
      name: "Beans",
      img: " data:image/jpeg;base64,",
    },
    {
      id: 3,
      name: "garri",

      img: "https://eatwellabi.com/wp-content/uploads/2022/06/Garri-6-720x480.jpg",
    },
    {
      id: 3,
      name: "onions",
      img: " data:image/jpeg;base64,",
    },
  ]);

  const addToCart = (item) => {
    setCart([...cart, item]);
    console.log(`${item.name} has been added to the cart.`);
  };

  const removeFromCart = (item) => {
    const updatedCart = cart.filter((cartItem) => cartItem.id !== item.id);
    setCart(updatedCart);
    console.log(`${item.name} has been removed from the cart.`);
  };
  return (
    <div className="container">
      <div className="nav_tab">
        <h1 className="mt-4">Shopping Cart</h1>
        <div>
          <img
            src="https://www.iconpacks.net/icons/2/free-add-to-cart-icon-3046-thumb.png"
            alt=""
          />
        </div>
      </div>

      <h2 className="mt-4">Items:</h2>
      <ul className="fruit_container">
        {items.map((item) => (
          <>
            <div className="fruit_container_inner" key={item.id}>
              <img src={item.img} className="img-fluid" alt="" />
              <p className="fruit_name"> {item.name}</p>

              <div className=" bnt_div">
                <button
                  className="btn btn-primary"
                  onClick={() => addToCart(item)}
                >
                  Add to Cart
                </button>
              </div>
            </div>
          </>
        ))}
      </ul>

      <h2 className="mt-4">Cart:</h2>
      <ul className="list-group">
        {cart.map((item) => (
          <>
            <li
              key={item.id}
              className="list-group-item d-flex justify-content-between align-items-center"
            >
              {item.name}
              <button
                className="btn btn-danger"
                onClick={() => removeFromCart(item)}
              >
                Remove from Cart
              </button>
            </li>
          </>
        ))}
      </ul>
    </div>
  );
}

export default ShoppingCart;
